import React from "react";
import { Header } from "../../components/header";
import {
  Column,
  Container,
  SubTitle,
  Text,
  TitleHighLight,
  TitlePrincipal,
  Wrapper,
} from "./styles";
import Button from "../../components/button";
import { Input } from "../../components/Input/Input";

const Login = () => {
  return (
    <>
      <Header />
      <Container>
        <Column>
          <TitlePrincipal>
            Chegou a <span/>
            <TitleHighLight>
              Hora <br />
            </TitleHighLight>
            de pequeno Phython
          </TitlePrincipal>
          <img src="./logo.png" />
        </Column>
        <Column>
        <Wrapper>
          <TitlePrincipal>Faça seu cadastro</TitlePrincipal>
          <SubTitle>Faça o seu Login e make a change...</SubTitle>
          <Input placeholder="Digite seu Email" />
          <Input placeholder="Digite sua Palavra Passe" />
          <Button title="Login" variant="secondary" />


        </Wrapper>

        </Column>
      </Container>
    </>
  );
};

export { Login };
